-- ----------------------------
-- Table structure for `cj_biz`
-- ----------------------------
DROP TABLE IF EXISTS `cj_biz`;
CREATE TABLE `cj_biz` (
  `biz` char(16) NOT NULL COMMENT '帐号主键',
  `uin` char(16) NOT NULL DEFAULT '' COMMENT 'uin',
  `key` char(96) NOT NULL DEFAULT '' COMMENT 'key',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '帐号名字',
  `time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`biz`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信采集帐号';

-- ----------------------------
-- Records of cj_biz
-- ----------------------------

-- ----------------------------
-- Table structure for `cj_content`
-- ----------------------------
DROP TABLE IF EXISTS `cj_content`;
CREATE TABLE `cj_content` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '表ID',
  `link` varchar(200) NOT NULL DEFAULT '' COMMENT '链接',
  `owner` varchar(30) NOT NULL DEFAULT '' COMMENT '所属公众号',
  `time` int(11) NOT NULL DEFAULT '0' COMMENT '发布日期',
  `title` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '文章标题',
  `cover` varchar(200) NOT NULL DEFAULT '' COMMENT '配图',
  `img` int(11) NOT NULL DEFAULT '0' COMMENT '图片数量',
  `video` int(11) NOT NULL DEFAULT '0' COMMENT '视频数量',
  `video_id` varchar(1024) NOT NULL DEFAULT '' COMMENT '视频id',
  `read` int(11) NOT NULL DEFAULT '0' COMMENT '阅读',
  `good` int(11) NOT NULL DEFAULT '0' COMMENT '赞',
  `used` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否被使用',
  PRIMARY KEY (`id`),
  UNIQUE KEY `link` (`link`),
  KEY `owner` (`owner`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='采集内容';

-- ----------------------------
-- Records of cj_content
-- ----------------------------

