-- ----------------------------
-- Table structure for `qrcode`
-- ----------------------------
DROP TABLE IF EXISTS `qrcode`;
CREATE TABLE `qrcode` (
  `ticket` varchar(256) NOT NULL DEFAULT '' COMMENT '微信二维码ticket，用于游戏用户和微信用户的绑定',
  `scene_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '腾讯需要的二维码id',
  `verify` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '如果腾讯的接口请求失败，那么返回6位数的验证码要求用户输入，以求得用户绑定',
  `game_id` varchar(32) NOT NULL COMMENT '游戏微信号ID',
  `game_uid` int(11) NOT NULL COMMENT '游戏里用户ID',
  `platform` varchar(16) NOT NULL COMMENT '游戏平台',
  `areaid` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '游戏大区',
  `groupid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '游戏服ID',
  `game_sex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '游戏中的性别',
  `game_name` varchar(32) NOT NULL DEFAULT '' COMMENT '游戏中的昵称',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间，每个二维码失效时间为1800秒',
  PRIMARY KEY (`ticket`),
  UNIQUE KEY `idx_ticket` (`ticket`) USING BTREE
) ENGINE=MEMORY DEFAULT CHARSET=utf8 COMMENT='给用户生成二维码';

