-- ----------------------------
-- Table structure for `wx_msg`
-- ----------------------------
DROP TABLE IF EXISTS `wx_msg`;
CREATE TABLE `wx_msg` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `openid` varchar(32) NOT NULL COMMENT '玩家微信ID',
  `gameid` varchar(32) NOT NULL COMMENT '游戏公众号ID',
  `create_time` int(11) NOT NULL COMMENT '接收到的时间，微信的信息就可以',
  `msg_type` varchar(10) NOT NULL DEFAULT '' COMMENT '微信类型',
  `content` varchar(128) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '文字内容',
  `event` varchar(20) NOT NULL DEFAULT '' COMMENT '哪种微信事件',
  `event_key` varchar(128) NOT NULL DEFAULT '' COMMENT '微信事件的内容，location可以合并放到这里',
  `kf` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1表示客服的回复；默认是0，用户的信息',
  `kf_name` varchar(32) NOT NULL DEFAULT '' COMMENT '值班客服的帐号',
  PRIMARY KEY (`id`),
  KEY `idx_gameid` (`gameid`) USING BTREE,
  KEY `idx_openid` (`openid`) USING BTREE,
  KEY `idx_createtime` (`create_time`) USING BTREE,
  KEY `idx_msg_type` (`msg_type`)
) ENGINE=InnoDB AUTO_INCREMENT=1028128 DEFAULT CHARSET=utf8 COMMENT='微信信息保存';

