-- ----------------------------
-- Table structure for `wx_user`
-- ----------------------------
DROP TABLE IF EXISTS `wx_user`;
CREATE TABLE `wx_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `nickname` varchar(64) CHARACTER SET utf8mb4 NOT NULL DEFAULT '' COMMENT '微信中昵称',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '微信中性别，值为1时是男性，值为2时是女性，值为0时是未知',
  `language` varchar(16) NOT NULL DEFAULT '' COMMENT '微信用户语言，zh_CN 简体，zh_TW 繁体，en 英语',
  `city` varchar(32) NOT NULL DEFAULT '' COMMENT '微信用户所在城市',
  `province` varchar(32) NOT NULL DEFAULT '' COMMENT '微信用户所在省份',
  `country` varchar(32) NOT NULL DEFAULT '' COMMENT '微信用户所在国家',
  `headimgurl` varchar(512) NOT NULL DEFAULT '' COMMENT '微信用户头像，最后一个数值代表正方形头像大小（有0、46、64、96、132数值可选，0代表640*640正方形头像），用户没有头像时该项为空',
  `latitude` float(10,6) NOT NULL DEFAULT '0.000000' COMMENT '微信上报的纬度',
  `longitude` float(10,6) NOT NULL DEFAULT '0.000000' COMMENT '微信上报的经度',
  `precision` float(10,6) NOT NULL DEFAULT '0.000000' COMMENT '精度',
  `os` varchar(16) NOT NULL DEFAULT '' COMMENT '最后使用的手机系统',
  `ver` varchar(16) NOT NULL DEFAULT '' COMMENT '最后使用的手机系统版本',
  `webkit` varchar(16) NOT NULL DEFAULT '' COMMENT '系统webkit版本',
  `model` varchar(50) NOT NULL DEFAULT '' COMMENT '手机型号',
  `wx_ver` varchar(100) NOT NULL DEFAULT '' COMMENT '微信浏览器版本',
  `client_ip` varchar(15) NOT NULL DEFAULT '' COMMENT '客户端IP',
  `ip_city` varchar(32) NOT NULL DEFAULT '' COMMENT 'ip所在的城市',
  `ip_isp` varchar(16) NOT NULL DEFAULT '' COMMENT 'ip所属的运营商',
  `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看过的最新的新闻id，用于判断是否有新的新闻',
  `created` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '记录插入时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `user` (`id`),
  KEY `LSB` (`latitude`,`longitude`)
) ENGINE=InnoDB AUTO_INCREMENT=34864 DEFAULT CHARSET=utf8 COMMENT='微信用户表';

-- ----------------------------
-- Records of wx_user
-- ----------------------------

