-- ----------------------------
-- Table structure for `wx_user_subscribe`
-- ----------------------------
DROP TABLE IF EXISTS `wx_user_subscribe`;
CREATE TABLE `wx_user_subscribe` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '用户id',
  `openid` varchar(32) NOT NULL DEFAULT '' COMMENT '用户关注公众号微信id',
  `gameid` char(15) NOT NULL DEFAULT '' COMMENT '游戏在微信的id',
  `subscribe_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '微信用户关注时间，为时间戳。如果用户曾多次关注，则取最后关注时间',
  `unsubscribe_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '取消关注的时间',
  `recv_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '微信用户最后活跃时间，用来判断客服API是否可用',
  `resp_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '游戏运营回复时间，用来判断是否需要自动回复',
  `nid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '看过的最新的新闻id，用于判断是否有新的新闻',
  `created` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间戳',
  PRIMARY KEY (`id`),
  KEY `idx_gameid` (`gameid`) USING BTREE,
  KEY `idx_openid` (`openid`) USING BTREE,
  KEY `idx_userid` (`userid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=34865 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of wx_user_subscribe
